import { StatusBar } from 'expo-status-bar';
import React, { Component} from 'react';
import { StyleSheet, Text, View, Image, TouchableWithoutFeedback, keyboard, TouchableOpacity, KeyboardAvoidingView } from 'react-native';

export default function Login() {
  return (
    <View style={styles.container}>
      <View style={styles.logoContainer}>
          <Image source={require('../assets/logo2.png')} style={styles.logo}>
            </Image>
              <Text style={styles.title} >
                Login
               </Text>
      </View>
      <View>
              <View style={styles.infoContainer}></View>
            </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000220',
    flexDirection: 'column',
  },
  logoContainer: {
    flex: 1,
    alignItem: 'center',
    justifyContent: 'center',
  },
  logo:{
    width: 150,
    height: 56,

  },
  title:{
    color: 'white',
    fontSize: 20,
    textAlign: 'center',
    marginTop: 15,
    opacity: 0.9,
  },
  infoContainer:{
    position: 'absolute',
    left: 0,
    right: 0,
    bottom: 0,
    height: 200,
    padding: 20,
    backgroundColor: 'red',
  }
});
